function findSum(arr) { 
  let sum = 0; 
  for (let i = 0; i < arr.length; i++) { 
    sum += arr[i]; 
  } 
  return sum; 
}

public class Singleton { 
  private static Singleton instance; 
  private Singleton() {} 
  public static Singleton Instance { 
    get { 
      if (instance == null) { 
        instance = new Singleton(); 
      } 
      return instance; 
    } 
  } 
}

func add(a: Int, b: Int) -> Int {
return a + b
